import React from 'react';

class Toolbar extends Component {
    render(){
        return <header className="toolbar">
            <nav>
                <div><a href="/">The Logo</a></div>
                <div className="toolbar_navigation-item"></div>
                <ul>
                    <li><a href="/">Home</a></li>
                    <li><a href="/">My Courses</a></li>
                </ul>

            </nav>
        </header>


    }
}

export default Toolbar;
